import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <div className="App">
      <Routes>
          <Route path='/' element={<Home />} />
      </Routes>
      <div className='one'></div>
      <div className='two'></div>
      <div className='three'></div>
    </div>
  );
}

export default App;
